import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

var element1 = <div><h1>My first react project</h1>
<br/> Addition : {10+10}
<br/>Substraction: {10-5}
<br/>Multiplication : {10*5}
<br/>Division : {10/5}</div>


var element2 = <h1>Session by kiran sir</h1>

var element = React.createElement('div',null,element1,element2)
//ReactDOM.render(element2, document.getElementById("root1"))
ReactDOM.render(element, document.getElementById("root"))

